import React from 'react';
import axios from 'axios';


class VideoList extends React.Component {
    constructor(props) {
        super();
        this.state = {
            videos: [],
        };
    }

    componentDidMount() {
        axios.get('http://localhost:3000/video')
            .then(res => {
                this.setState({videos : {...this.state.videos, ...res.data}});
            })
    }

    render() {
        const listItems = this.state.videos.map((video) =>
            <li>{video.title}</li>
        );
        return (
            <div>
                <h1>Videos</h1>
                <ul>
                    {listItems}
                </ul>
            </div>
        );
    }
}

export default VideoList;
